import React, { useState } from "react";
import "../styles.css";
import jsPDF from "jspdf";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    customerName: "",
    jobAddress: "",
    claimNumber: "",
    jobType: "",
    moistureReadings: "",
    technicianNotes: "",
    paymentStatus: "",
    waitingInsurance: "",
    equipmentUsed: "",
    psychrometrics: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const generatePDF = () => {
    const doc = new jsPDF();
    doc.text("Mitigation Report - ToolbeltAI", 10, 10);

    // Customer Info
    doc.text(`Customer Name: ${formData.customerName}`, 10, 30);
    doc.text(`Job Address: ${formData.jobAddress}`, 10, 40);
    doc.text(`Claim Number: ${formData.claimNumber}`, 10, 50);

    // Job Details
    doc.text(`Job Type: ${formData.jobType}`, 10, 70);
    doc.text(`Moisture Readings: ${formData.moistureReadings}`, 10, 80);
    doc.text(`Equipment Used: ${formData.equipmentUsed}`, 10, 90);

    // Payment
    doc.text(`Payment Status: ${formData.paymentStatus}`, 10, 110);
    doc.text(`Waiting on Insurance: ${formData.waitingInsurance}`, 10, 120);

    // Notes
    doc.text("Technician Notes:", 10, 140);
    doc.text(doc.splitTextToSize(formData.technicianNotes, 180), 10, 150);

    doc.save("mitigation_report.pdf");
  };

  return (
    <div className="form-container">
      <h2>üõ† ToolbeltAI Mitigation Logger</h2>

      {/* Customer Details */}
      <div className="form-section">
        <h3>üìç Customer & Job Info</h3>
        <input name="customerName" placeholder="Customer Name" onChange={handleChange} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleChange} />
        <input name="claimNumber" placeholder="Claim Number" onChange={handleChange} />
      </div>

      {/* Job Details */}
      <div className="form-section">
        <h3>üìã Job Details</h3>
        <input name="jobType" placeholder="Type of Job (Water, Fire, Mold)" onChange={handleChange} />
        <textarea name="moistureReadings" placeholder="Room Moisture Readings" onChange={handleChange} />
        <textarea name="equipmentUsed" placeholder="Equipment Used (Dehus, Fans, Air Movers)" onChange={handleChange} />
      </div>

      {/* Psychrometrics */}
      <div className="form-section">
        <h3>üå° Psychrometric Table</h3>
        <textarea name="psychrometrics" placeholder="Temp / RH / AH / GPP / etc." onChange={handleChange} />
      </div>

      {/* Payment */}
      <div className="form-section">
        <h3>üíµ Payment Status</h3>
        <select name="paymentStatus" onChange={handleChange}>
          <option value="">Payment Status</option>
          <option value="Paid">Paid</option>
          <option value="Waiting on Insurance">Waiting on Insurance</option>
          <option value="Customer Owes">Customer Owes</option>
        </select>
        <select name="waitingInsurance" onChange={handleChange}>
          <option value="">Waiting on Insurance?</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>
      </div>

      {/* Technician Notes */}
      <div className="form-section">
        <h3>üß∞ Technician Notes</h3>
        <textarea
          name="technicianNotes"
          placeholder="Detailed notes for insurance & future techs"
          onChange={handleChange}
        />
      </div>

      {/* Buttons */}
      <button onClick={generatePDF}>üìÑ Export PDF</button>
    </div>
  );
};

export default MitigationForm;
